import React from 'react';
import './navbar.css';
import { Link } from 'react-router-dom';

const NavBar = () => {
  return (
    <div className="navbar">
      <h1>FitBud</h1>
      <div classname="links">
        <Link to="/">Home</Link>
        <Link to="/login">Login</Link >
      </div>
    </div>
  );
}
export default NavBar;
